import React from 'react'
import {Link} from "react-router-dom"
import "./PhotoButtonStyle.css"


export default function PhotoButton({btnLink,btnTxt,outline}) {
  return (
    <div className="photo_btn" outline={outline}>
        <Link className="button" to = {btnLink}>
            {btnTxt}
        </Link>

    </div>
  )
}
